        <div className="container">
          <div className="row">
            <div className="col-md-6">
              <img
                src="your-image.jpg"
                alt="Your Image"
                className="img-fluid animated-image"
              />
            </div>
            <div className="col-md-6">
              <h1 className="display-4">Welcome to My Portfolio</h1>
              <p className="lead animated-text">
                I'm a passionate web developer
              </p>
            </div>
          </div>
        </div>
      </header>

      {/* Rest of the code */}
    </div>
  );
};

export default Home;
